import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const UserStatistics = () => {
  const [statistics, setStatistics] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  
  useEffect(() => {
    const fetchStatistics = async () => {
      try {
        setLoading(true);
        setError('');
        
        const response = await axios.get('http://localhost:5000/api/news/statistics');
        setStatistics(response.data);
      } catch (err) {
        setError(err.response?.data?.message || 'Failed to fetch statistics');
      } finally {
        setLoading(false);
      }
    };
    
    fetchStatistics();
  }, []);
  
  return (
    <div className="flex flex-col">
      <div className="flex justify-between items-center mb-6">
        <h2 className="text-2xl font-bold">User Statistics</h2>
        <Link to="/admin" className="text-blue-600 hover:text-blue-800">
          ← Back to Admin Panel
        </Link>
      </div>
      
      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
          {error}
        </div>
      )}
      
      {loading ? (
        <div className="text-center py-8">Loading...</div>
      ) : statistics ? (
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div className="bg-white shadow-md rounded-lg overflow-hidden">
            <div className="px-6 py-4 bg-blue-600 text-white">
              <h3 className="text-lg font-semibold">General Statistics</h3>
            </div>
            <div className="p-6">
              <div className="grid grid-cols-2 gap-4">
                <div className="bg-blue-50 p-4 rounded-lg text-center">
                  <div className="text-3xl font-bold text-blue-600">{statistics.userCount}</div>
                  <div className="text-sm text-gray-600 mt-1">Total Users</div>
                </div>
                
                <div className="bg-blue-50 p-4 rounded-lg text-center">
                  <div className="text-3xl font-bold text-blue-600">{statistics.checkCount}</div>
                  <div className="text-sm text-gray-600 mt-1">Total Checks</div>
                </div>
              </div>
              
              <div className="mt-6">
                <div className="text-sm text-gray-600 mb-2">Average Fake News Percentage</div>
                <div className="relative pt-1">
                  <div className="flex mb-2 items-center justify-between">
                    <div>
                      <span className="text-xs font-semibold inline-block py-1 px-2 uppercase rounded-full text-red-600 bg-red-200">
                        {statistics.avgFakePercentage}%
                      </span>
                    </div>
                  </div>
                  <div className="overflow-hidden h-2 mb-4 text-xs flex rounded bg-red-200">
                    <div style={{ width: `${statistics.avgFakePercentage}%` }} className="shadow-none flex flex-col text-center whitespace-nowrap text-white justify-center bg-red-500"></div>
                  </div>
                </div>
              </div>
            </div>
          </div>
          
          <div className="bg-white shadow-md rounded-lg overflow-hidden">
            <div className="px-6 py-4 bg-green-600 text-white">
              <h3 className="text-lg font-semibold">Top 5 Users</h3>
            </div>
            <div className="p-6">
              {statistics.topUsers.length === 0 ? (
                <div className="text-center py-4 text-gray-600">No data available</div>
              ) : (
                <div className="space-y-4">
                  {statistics.topUsers.map((user, index) => (
                    <div key={index} className="flex items-center">
                      <div className="w-8 h-8 bg-green-100 rounded-full flex items-center justify-center mr-3">
                        <span className="text-green-600 font-medium">{index + 1}</span>
                      </div>
                      <div className="flex-grow">
                        <div className="font-medium">{user.nickname}</div>
                        <div className="text-sm text-gray-500">{user.check_count} checks</div>
                      </div>
                      <div className="w-16 text-right">
                        <div className="text-sm font-medium">
                          {((user.check_count / statistics.checkCount) * 100).toFixed(1)}%
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </div>
          </div>
        </div>
      ) : null}
    </div>
  );
};

export default UserStatistics;
